const ExpenseList = ({ expenseList }) => {
  return (
    <div className="card" style={{ margin: 10 }}>
      <li>
        {expenseList}
        <i className="trash alternate"></i>
      </li>
      <li>{expenseList}</li>
    </div>
  );
};

export default ExpenseList;
